INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 2, 5, 2, 325, 24001, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 40011, 0);
